            {close => (
              <form className="exercise-add-form" onSubmit={(e) => {
                //handleRecordAddSubmit(e)
                close()
              }}>
                <legend>Add Exercise</legend>
                <input type="text" placeholder="exercise name..."/>

                <input id="form-submit" type="submit" value="Add" />
